import React from 'react';
import './Contact.css';
import linkedin from './assets/linkedin.png';
import github from './assets/github.png';

const Contact = () => (
    <section className="contact">
        <div className="contact-container">
            <h2>Contact Me!</h2>
            <div className="btns">
                    <a href="./assets/CS Resume 2024.pdf" download><button className="link-btn">Download CV</button></a>
                    <a href="./Contact.js"><button className="link-btn">Contact Me</button></a>
                </div>
            <div className="form-container">
                <form action="https//formsubmit.co/mendoza.a01@outlook.com" method="POST">
                    <input type="text" name="name" placeholder="Your Name" required />
                    <input type="email" name="email" placeholder="Your Email" required />
                    <input type="text" name="message" placeholder="Your Message" required />
                    <button type="submit">Send</button>
                </form>
            </div>
        </div>
    </section>
);

export default Contact;
